//Data stuff
async function getBooks(subject) {
  const response = await fetch(
    "https://www.googleapis.com/books/v1/volumes?q=subject:${subject}"
  );
  var books;
  response.json().then(
    (val) => {
      books = val.items;
    },
    (reason) => {
      console.log(reason);
    }
  );

  return books;
}

